import React from 'react';
import TradingViewWidget, { Themes } from 'react-tradingview-widget';
 
const LiveCharts = () => (
  <TradingViewWidget
    symbol="NASDAQ:AAPL"
    theme={Themes.DARK}
    locale="en"
    size={{width: '900', height: '900'}}
    interval= "D"
    timezone="Etc/UTC"

  />
);
